import React from "react";
import Navbar from "../components/navbar";
import AboutHeader from "../components/aboutheader";
import Cards from "../components/cards";
import Footer from "../components/footer";

const Home = () => {
    return (
        <div>
        <Navbar />
        <AboutHeader/>

        <Cards />
        <Footer />
        </div>
    );
    };

    export default Home;
